INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES ("2023/09/22 14:59:59", 10001, 1, 1, 2002, 1, "2023/06/30 12:00:00", 1.47, 2, "クローチェ", "いらっしゃいませっ♪\nキャラバンコインを使って\n買い物ができますよっ！", 0.0, -470.0, 126401);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES ("2023/09/22 14:59:59", 10002, 1, 2, 2002, 2, "2023/06/30 12:00:00", 2.15, 1, "クローチェ", "素敵な品が揃ってるので\nたーっくさん買っていって\nくださいねっ♪", 0.0, -470.0, 126401);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES ("2023/09/22 14:59:59", 10003, 1, 1, 2002, 2, "2023/06/30 12:00:00", 0.0, 2, "ライラエル", "ショップへようこそ\nキャラバンコインはこちら\nで買い物に使えますよ", 0.0, -470.0, 126501);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES ("2023/09/22 14:59:59", 10004, 1, 2, 2002, 1, "2023/06/30 12:00:00", 0.0, 1, "ライラエル", "こちらのショップで\n買い物をして、素敵な\n旅を楽しんでくださいね", 0.0, -470.0, 126501);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES ("2023/12/22 14:59:59", 10005, 2, 1, 2002, 2, "2023/09/15 15:00:00", 0.0, 2, "リンド", "いらっしゃいませ\nキャラバンコインを使って\nお買い物ができますよ", 0.0, -470.0, 127702);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES ("2023/12/22 14:59:59", 10006, 2, 2, 2002, 2, "2023/09/15 15:00:00", 0.0, 2, "リンド", "ショップの掃除は完璧です\n姫さま直営のお店として\n当然のことですから", 0.0, -470.0, 127702);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES ("2023/12/22 14:59:59", 10007, 2, 1, 2002, 1, "2023/09/15 15:00:00", 0.0, 1, "ヴルム", "ショップへようこそ\nキャラバンコインと品物を\n交換できるんで、よければ", 0.0, -470.0, 127802);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES ("2023/12/22 14:59:59", 10008, 2, 2, 2002, 2, "2023/09/15 15:00:00", 6.5, 1, "ヴルム", "なんで店番なんか…\nま、やりますけど\n好きな品物をどうぞ", 0.0, -470.0, 127802);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES ("2024/03/22 14:59:59", 10009, 3, 1, 2002, 2, "2023/12/15 15:00:00", 0.0, 1, "アネモネ", "──いらっしゃいませ\n買い物しても、いいですよ\nキャラバンコインがあれば", 0.0, -470.0, 129602);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES ("2024/03/22 14:59:59", 10010, 3, 2, 2002, 2, "2023/12/15 15:00:00", 0.0, 1, "アネモネ", "──もっと笑顔がほしい？\nいくらコインを積まれても\n売れない物はありますから", 0.0, -470.0, 129602);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES ("2024/03/22 14:59:59", 10011, 3, 1, 2002, 1, "2023/12/15 15:00:00", 0.0, 1, "ネフィ=ネラ", "ようこそおいでなんし\nキャラバンコインをこちら\nで交換して進ぜんしょう", 0.0, -470.0, 129701);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES ("2024/03/22 14:59:59", 10012, 3, 2, 2002, 2, "2023/12/15 15:00:00", 6.2, 1, "ネフィ=ネラ", "ところで、お前さまは\nいくらで贖えるのか喃？\n──フフ、冗談でありんす", 0.0, -470.0, 129701);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES ("2024/06/22 14:59:59", 10013, 4, 1, 2002, 3, "2024/03/15 15:00:00", 3.1, 5, "カノン", "い、いらっしゃいませっ！\n…くっ…このあたくし様が\n店番なんて…屈辱ですわっ", 0.0, -470.0, 130301);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES ("2024/06/22 14:59:59", 10014, 4, 2, 2002, 3, "2024/03/15 15:00:00", 6.15, 2, "カノン", "あら、あたくしをご所望？\nお生憎様、そんな小銭では\n…買えちゃうんですの！？", 0.0, -470.0, 130301);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES ("2024/06/22 14:59:59", 10015, 4, 1, 2002, 2, "2024/03/15 15:00:00", 0.0, 2, "ナーナ", "いらっしゃいませ～♪\nきゃらばんこいん？を\n交換できるんだってー", 0.0, -470.0, 130401);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES ("2024/06/22 14:59:59", 10016, 4, 2, 2002, 2, "2024/03/15 15:00:00", 3.35, 1, "ナーナ", "甘いのくれたら、\nお礼にナーナの拾った\n松ぼっくりあげちゃうよ！", 0.0, -470.0, 130401);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES ("2024/09/22 14:59:59", 10017, 5, 1, 2002, 1, "2024/06/15 15:00:00", 0.0, 1, "ホウオウ", "ショップへようこそ\nこの鳳凰が、皆さんに\n祝福を差し上げましょう", 0.0, -470.0, 130502);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES ("2024/09/22 14:59:59", 10018, 5, 2, 2002, 2, "2024/06/15 15:00:00", 3.18, 1, "ホウオウ", "ほーちゃんと呼ぶ権利は\n売っていませんよ？\n騎士さんへの、特別です！", 0.0, -470.0, 130502);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES ("2024/09/22 14:59:59", 10019, 5, 3, 2002, 4, "2024/06/15 15:00:00", 0.0, 4, "ホウオウ", "うﾞぇぇえんっ！まﾞだごの\n格好になっぢゃいまじだ！\n寄付をお願いじまず～っ！", 0.0, -470.0, 130503);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES ("2024/09/22 14:59:59", 10020, 5, 1, 2002, 1, "2024/06/15 15:00:00", 4.9, 2, "ネア", "おっすー♪\nなんでも交換してけー\nカリザきゅん以外で", 0.0, -470.0, 123301);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES ("2024/09/22 14:59:59", 10021, 5, 2, 2002, 1, "2024/06/15 15:00:00", 4.8, 2, "ネア", "ところで、騎士きゅんは\nおいくら万ルピ？\nジョーダンぬ・き・で♡", 0.0, -470.0, 123301);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES ("2024/12/22 14:59:59", 10022, 6, 1, 2002, 3, "2024/09/15 15:00:00", 4.922, 1, "カリザ", "ケッ、なんでオレ様が店番\nなんざ…って来んなキイロ\nオレは売りモンじゃねー！", 0.0, -470.0, 133301);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES ("2024/12/22 14:59:59", 10023, 6, 2, 2002, 3, "2024/09/15 15:00:00", 9.638, 5, "カリザ", "い、言わなきゃダメか？\n「…いらっしゃいませ…」\nクソッ、笑うんじゃねー！", 0.0, -470.0, 133301);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES ("2024/12/22 14:59:59", 10024, 6, 1, 2002, 1, "2024/09/15 15:00:00", 2.88, 2, "ミーア", "ショップへようこそ～\nネラさまの腹心…的な私が\n店番させていただきま～す", 0.0, -470.0, 133401);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES ("2024/12/22 14:59:59", 10025, 6, 2, 2002, 5, "2024/09/15 15:00:00", 4.818, 1, "ミーア", "私の抜け殻とか、\n需要ありますかね～…\nって冗談ですよ、冗談！", 0.0, -470.0, 133401);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES ("2025/03/22 14:59:59", 10026, 7, 1, 2002, 2, "2024/12/15 15:00:00", 1.78, 1, "グレイス", "へい、らっしゃい\nさ、騎士氏。冥土の土産は\nなにがいいですか？", 0.0, -470.0, 133002);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES ("2025/03/22 14:59:59", 10027, 7, 2, 2002, 1, "2024/12/15 15:00:00", 6.15, 7, "グレイス", "商品をお買い上げ毎に\nグレイスちゃんポイントを\n差し上げます。嘘ですが", 0.0, -470.0, 133002);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES ("2025/03/22 14:59:59", 10028, 7, 1, 2002, 6, "2024/12/15 15:00:00", 4.28, 2, "ヴァイオレット", "ようこそいらっしゃいませ\n…接客とは、このような\n振舞で宜しいでしょうか？", 0.0, -470.0, 133102);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES ("2025/03/22 14:59:59", 10029, 7, 2, 2002, 1, "2024/12/15 15:00:00", 0.0, 1, "ヴァイオレット", "じめじめした商品は\nございませんので\n安心してお買い求め下さい", 0.0, -470.0, 133102);
